import {Link} from 'react-router-dom';
function Personalcard() {
  return (
      <div className="conteiner mt-4">
      	<div className="row">
      		<aside className="col-3-md-3">
      			<div className="list-group">
      				<Link to='/' className="list-group-item list-group-item-action"> List 1</Link>
      				<Link to='/' className="list-group-item list-group-item-action"> List 1</Link>
      				<Link to='/' className="list-group-item list-group-item-action"> List 1</Link>
      				<Link to='/' className="list-group-item list-group-item-action"> List 1</Link>
      				<Link to='/' className="list-group-item list-group-item-action"> List 1</Link>
      				<Link to='/' className="list-group-item list-group-item-action"> List 1</Link>
      			</div>
      		</aside>
      		<section className="col-md-9"></section>

        </div>
      </div>
  );
}

export default Personalcard;
